window.bookSummaryJSON = "<p>Henry and Jason somehow survived being kidnapped to Ludus, a monster-filled, sword and sorcery world. They managed to make friends, pay their rent, and they even founded their own adventuring business, Delvers LLC. </p> <p>Unfortunately, by overcoming the odds and creating a reputation for themselves in such short time, monarchs and nobles have taken notice of the two men from Earth. Foreign, deadly struggles may be unavoidable for Delvers LLC. </p> <p>Henry and Jason are about to discover something even more dangerous than murderous monsters on Ludus: politics. </p>"; 
